extension I18nRawKeysExtensions on String {
  /// 支持替换占位符
  String trPlaceholder([List<String> args = const []]) {
    var key = tr;
    if (args.isNotEmpty) {
      for (final arg in args) {
        key = key.replaceFirst(RegExp(r'{}'), arg.toString());
      }
    }
    return key;
  }
}
